import JsonPlaceHolder from '../apis/JsonPlaceHolder';

export const fetchPost = () => {
    return function(dispatch) {
        const response = JsonPlaceHolder.get('/post');
        return {
            type : 'FETCH_POST',
            payload : response
        };
    };



}
